import { promiseFirst } from "./index";
import { delay, logTime } from "helper";

const tasks = [
	() => delay.error(1000, "error delay1"),
	() => delay.error(500, "error delay2"),
	() => delay(200, "delay3"),
	() => delay(200, "delay4"),
];

try {
	logTime(async () => {

		const r = await promiseFirst(tasks);
		console.log("r", r);
	});
} catch (e) {
	console.log("e", e);
}

